import React from 'react'
import CommonCardPage from '../Common/CommonCardPage/CommonCardsPage'
function Projects() {
    const tabsDetails = ["React", "RPA", ".Net"];
    const data = [{
        tab: 0,
        thumbnail: "https://miro.medium.com/max/1200/1*yjH3SiDaVWtpBX0g_2q68g.png",
        title: "Elog on-call management  ",
        hoverData: "React, Redux, Saga, Thunk, Material UI,npm,webpack, Flask, Ldap, PostgreSQL, SQLAlchemy,AzureAD, nginx, RestfulAPI.",
        channel: " Hover to see tech stack",
        views: "11M views  • 0 years ago",
        desp: "Created a ticket logging website for cerner to log and monitor tickets using react redux as the frontend and flask in the backend. Used a lot of RESTful APIs from rapid to fulfill the use case."
    },
    {
        tab: 1,
        thumbnail: "https://www.cerner.com/gb/-/media/cerner-media-united-states/author/cerner-author-image.png?vs=1&h=396&w=704&la=en&hash=97F19D340CEE18D450E923844A1B99FB",
        title: "Cerner Corporation  ",
        hoverData: "React, Redux, Saga, Thunk, Material UI,npm,webpack, Flask, Ldap, PostgreSQL, SQLAlchemy,AzureAD, nginx, RestfulAPI.",
        channel: " Software Intern",
        views: "9M views  • 12/2019-06/2020",
        desp: "I did my internship for 6 months in the field of web development. I mainly worked on react.js, redux and flask. Being in cerner i also got the opportunity to learn django , ruby as well as ruby on rails. I made a full stack website for cerner during this period."
    },
    {
        tab: 1,
        thumbnail: "https://www.mcafee.com/content/dam/consumer/en/company-logo/McAFEE_TAG_H_RGB.png",
        title: "McAfee",
        hoverData: "React, Redux, Saga, Thunk, Material UI,npm,webpack, Flask, Ldap, PostgreSQL, SQLAlchemy,AzureAD, nginx, RestfulAPI.",
        channel: "Summer Intern  ",
        views: " 5M views  • 06/2019-07/2019",
        desp: " I did my summer internship in McAfee's team called E-Policy orchestrator. Worked as a vulnerability tester."
    }]
    return (
        <CommonCardPage page="Projects" tabsDetails={tabsDetails} data={data} icon="https://image.flaticon.com/icons/png/512/2683/2683272.png" />
    )
}

export default Projects
